import React, { useState, useEffect, Fragment } from "react";
import Navbar from "../../Components/Navbar";
import SubjectsList from "../../Components/SubjectsList";
import axios from "axios";
import { ToastContainer, toast } from "react-toastify";
import "react-toastify/dist/ReactToastify.css";
import { useLocation } from "react-router-dom";

function Subjects() {
  const [data, setData] = useState([]);

  const location = useLocation();
  useEffect(() => {
    axios
      .get(`https://localhost:7151/api/Subject/GetSubject`)
      .then((result) => {
        setData(result.data);
      })
      .catch((error) => {
        toast.error(error.toString());
      });
  }, [location.state.studentId.studentId]);
  console.log(data);
  return (
    <>
      <Fragment>
        <ToastContainer />
        <Navbar
          text={
            location.state.studentFirstName.firstName +
            " " +
            location.state.studentLastName.lastName
          }
        />

        <Container>
          <Row>
            <Col>
              <h1 className="h1Label">First name</h1>
              <Form.Control
                className="inputName"
                type="text"
                placeholder="First Name"
                value={firstName}
                onChange={(e) => setFirstName(e.target.value)}
              />
            </Col>
            <Col>
              <h1 className="h1Label">Last name</h1>
              <Form.Control
                className="inputName"
                type="text"
                placeholder="Last Name"
                value={lastName}
                onChange={(e) => setLastName(e.target.value)}
              />
            </Col>
            <Col>
              <h1 className="h1Label">Age</h1>
              <Form.Control
                className="age"
                type="text"
                placeholder="Age"
                value={age}
                onChange={(e) => setAge(e.target.value)}
              />
            </Col>
            <Col>
              <Form>
                <h1 className="h1Label">Budget</h1>
                <Form.Check
                  className="isBudget"
                  checked={Budget === "YES" ? true : false}
                  onChange={(e) => setHandleBudget(e)}
                />
              </Form>
            </Col>
            <Col>
              <Button
                variant="success"
                className="addButton"
                onClick={() => handleCreate()}
              >
                Add New Subject
              </Button>
            </Col>
          </Row>
        </Container>

        <SubjectsList subjectsData={data}></SubjectsList>
      </Fragment>
    </>
  );
}

export default Subjects;
